// src/AppRoutes.jsx أو routes/index.jsx
import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { useAuth } from './context/AuthContext';
import Layout from './components/Layout';
import Login from './pages/Login';

// صفحات المدير
import AdminDashboard from './pages/admin/Dashboard';
import UsersManagement from './pages/admin/UsersManagement';
import BranchesManagement from './pages/admin/BranchesManagement';
import GamesManagement from './pages/admin/GamesManagement';
import RentalsManagement from './pages/admin/RentalsManagement';
import RentalsRevenueAnalysis from './pages/admin/RentalsRevenueAnalysis';
import Settings from './pages/admin/Settings';

// صفحات الموظف
import EmployeeDashboard from './pages/employee/Dashboard';
import Rentals from './pages/employee/Rentals';

// Loader component
const LoadingScreen = () => (
  <div className="loading-screen">
    <div className="spinner"></div>
    <p>جاري التحميل...</p>
  </div>
);

// Protected Route Component
const ProtectedRoute = ({ children, allowedRoles = [] }) => {
  const { isAuthenticated, user, loading } = useAuth();
  
  if (loading) {
    return <LoadingScreen />;
  }
  
  if (!isAuthenticated) {
    return <Navigate to="/login" replace />;
  }
  
  if (allowedRoles.length > 0 && !allowedRoles.includes(user?.role)) {
    return <Navigate to="/unauthorized" replace />;
  }
  
  return children;
};

// Route for unauthorized access
const Unauthorized = () => (
  <div className="unauthorized-page">
    <h1>⛔ غير مصرح بالوصول</h1>
    <p>ليس لديك صلاحيات للوصول إلى هذه الصفحة.</p>
    <Link to="/" className="btn btn-primary">العودة للرئيسية</Link>
  </div>
);

// Main App Routes Component
const AppRoutes = () => {
  return (
    <Routes>
      {/* الصفحة الرئيسية واللوجين */}
      <Route path="/" element={<Navigate to="/login" replace />} />
      <Route path="/login" element={<Login />} />
      <Route path="/unauthorized" element={<Unauthorized />} />
      
      {/* Routes للمدير */}
      <Route path="/admin" element={
        <ProtectedRoute allowedRoles={['admin']}>
          <Layout />
        </ProtectedRoute>
      }>
        <Route index element={<AdminDashboard />} />
        <Route path="dashboard" element={<AdminDashboard />} />
        <Route path="users" element={<UsersManagement />} />
        <Route path="branches" element={<BranchesManagement />} />
        <Route path="games" element={<GamesManagement />} />
        <Route path="rentals" element={<RentalsManagement />} />
        <Route path="customers" element={<CustomersManagement />} />
        <Route path="customers/:id" element={<CustomersManagement />} />
        <Route path="customers/:id/edit" element={<CustomersManagement />} />
        <Route path="reports" element={<RentalsRevenueAnalysis />} />
        <Route path="settings" element={<Settings />} />
        <Route path="revenus" element={<RentalsRevenueAnalysis />} />
      </Route>
      
      {/* Routes للموظف ومدير الفرع */}
      <Route path="/employee" element={
        <ProtectedRoute allowedRoles={['employee', 'branch_manager', 'admin']}>
          <Layout />
        </ProtectedRoute>
      }>
        <Route index element={<EmployeeDashboard />} />
        <Route path="dashboard" element={<EmployeeDashboard />} />
        <Route path="rentals" element={<Rentals />} />
      </Route>
      
      {/* صفحة غير موجودة */}
      <Route path="*" element={
        <div className="not-found-page">
          <h1>404 - الصفحة غير موجودة</h1>
          <p>الصفحة التي تبحث عنها غير موجودة.</p>
          <Link to="/login" className="btn btn-primary">العودة للصفحة الرئيسية</Link>
        </div>
      } />
    </Routes>
  );
};

export default AppRoutes;
